BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "alcal_persona" (
	"id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"apellido"	varchar(100),
	"nombre"	varchar(100),
	"num_dni"	integer,
	"domicilio_calle"	varchar(100),
	"domicilio_numero"	integer,
	"telefono_1"	varchar(100),
	"telefono_2"	varchar(100),
	"telefono_3"	varchar(100),
	"observacion"	text,
	"pais_de_nacimiento"	varchar(2),
	"genero"	varchar(20),
	"tipo"	varchar(20),
	"email"	varchar(254),
	"fnac"	date
);
CREATE TABLE IF NOT EXISTS "alcal_estudiante" (
	"legajo"	integer NOT NULL,
	"persona_ptr_id"	integer NOT NULL UNIQUE,
	"activx"	bool,
	"orden"	integer,
	"libro"	varchar(5),
	"folio"	integer,
	"anio_ingreso"	integer,
	"grupo_tec"	integer,
	"ficha_de_inscripcion"	bool,
	"foto_dni_estudiante"	bool,
	"foto_dni_estudiante_archivo"	varchar(100),
	"foto_dni_responsable"	bool,
	"partida_de_nacimiento"	bool,
	"vacunas"	bool,
	"certificado"	bool,
	"url_foto"	varchar(200),
	"archivo_de_seguimiento"	varchar(200),
	"porcentaje_beca"	integer,
	"adeuda_id"	integer,
	"curso_id"	integer,
	"responsable_id"	integer,
	"vinculo"	varchar(50),
	PRIMARY KEY("legajo"),
	FOREIGN KEY("responsable_id") REFERENCES "alcal_padre"("persona_ptr_id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("curso_id") REFERENCES "alcal_curso"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("adeuda_id") REFERENCES "alcal_documentacion"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("persona_ptr_id") REFERENCES "alcal_persona"("id") DEFERRABLE INITIALLY DEFERRED
);
CREATE INDEX IF NOT EXISTS "alcal_estudiante_responsable_id_fb2895e9" ON "alcal_estudiante" (
	"responsable_id"
);
CREATE INDEX IF NOT EXISTS "alcal_estudiante_curso_id_5190d1c1" ON "alcal_estudiante" (
	"curso_id"
);
CREATE INDEX IF NOT EXISTS "alcal_estudiante_adeuda_id_52a0d82c" ON "alcal_estudiante" (
	"adeuda_id"
);
COMMIT;
